import React from 'react';
import '../styles/AboutMe.css';

const AboutMe = () => {
  return (
    <section id="about-me" className="about-me">
      <div className="about-picture">
        <img src="/path/to/your-picture.jpg" alt="Your Name" />
      </div>
      <div className="about-description">
        <p>Write a short description about yourself here.</p>
        <ul className="skills">
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
          <li>React</li>
          <li>Node.js</li>
        </ul>
      </div>
    </section>
  );
};

export default AboutMe;
